import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file, using 'domcontentloaded' for local files
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // There are multiple "Your Profile" links, we'll click the first one we find.
    // Using getByText is a robust way to find elements.
    const profileLink = page.getByText('Your Profile', { exact: true }).first();
    await profileLink.click();

    // Wait for the profile section to be dynamically rendered by the script
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Screenshot the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Harvest the profile information
    const profileHeader = page.locator('.profile-header');

    const fullName = await profileHeader.locator('h2').innerText();
    const username = await profileHeader.locator('.username').innerText();
    const bio = await profileHeader.locator('.bio').innerText();

    // Extract stats
    const stats = {};
    const statElements = await page.locator('.profile-stats .stat').all();
    for (const statElement of statElements) {
      const label = await statElement.locator('.stat-label').innerText();
      const number = await statElement.locator('.stat-number').innerText();
      stats[label.toLowerCase()] = number;
    }

    const extractedData = {
      fullName,
      username,
      bio,
      stats
    };

    return {
      success: true,
      action: "Successfully navigated to the profile section and harvested user information.",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error to help with debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
    screenshots.push(path.join(screenshotsDir, 'error_screenshot.png'));

    return {
      success: false,
      action: "Failed to harvest user profile information.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
